/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "google-play"
    }}>{`Google Play`}</h1>
    <h2 {...{
      "id": "virtual-devices"
    }}>{`Virtual Devices`}</h2>
    <p>{`Genymotion is useful to grab a bunch of different emulators for Android and come with a personal use or paid license. `}</p>
    <p>{`The device version and Genymotion may need to be aligned, so to do so, create a new Virtual Device.`}</p>
    <p>{`This can be easily done by selecting `}<inlineCode parentName="p">{`Create`}</inlineCode>{`, choosing a device and then naming it to something useable like `}<inlineCode parentName="p">{`reactnative`}</inlineCode>{`.`}</p>
    <h2 {...{
      "id": "testing-the-app-on-the-emulator"
    }}>{`Testing the app on the emulator`}</h2>
    <p>{`To do so, first run the emulator. After the emulator is up and running, use `}<inlineCode parentName="p">{`react-native run-android`}</inlineCode>{` on the CLI to start the app. The CLI will respond if there are any errors.`}</p>
    <h2 {...{
      "id": "uploading-to-the-google-play-store"
    }}>{`Uploading to the Google Play Store`}</h2>
    <h2 {...{
      "id": "debugging"
    }}>{`Debugging`}</h2>
    <p><strong parentName="p">{`General Notes`}</strong></p>
    <p>{`Running a build from the IDE will generally give better support for debugging issues and auto-updating code.`}</p>
    <p>{`Some errors I've come across:`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Error`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Resolution`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`error: could not install *smartsocket* listener: Address already in use`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ensure socket not in use eg no `}<inlineCode parentName="td">{`gulp watch`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Component Install error`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Update your install for `}<inlineCode parentName="td">{`android/build.gradle`}</inlineCode>{` (look for buildToolsVersion) - Android Studio can automate this for you`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`Could not get BatchedBridge, make sure your nundle is packaged correctly`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Run `}<inlineCode parentName="td">{`react-native start`}</inlineCode>{` from the CLI and reload app`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`UNMET PEER DEPENDENCY`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`rm -rf node-modules/ && npm cache clear && npm install`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`protected boolean getUseDeveloperSupport()`}</inlineCode>{` issue`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Change `}<inlineCode parentName="td">{`protected`}</inlineCode>{` to `}<inlineCode parentName="td">{`public`}</inlineCode>{` (Java Error)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`@providesModule naming collision`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`If caused by react-native-router-flux -> update or search Github`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Full cache reset`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`watchman watch-del-all && rm -rf node_modules/ && npm cache clean && npm install && npm start -- --reset-cache`}</td>
        </tr>
      </tbody>
    </table>
    <p><strong parentName="p">{`react-native-router-flux issues`}</strong></p>
    <p>{`This one was a bit tricky - some useful Github pages:`}</p>
    <p><a parentName="p" {...{
        "href": "https://github.com/aksonov/react-native-router-flux/issues/1803"
      }}>{`https://github.com/aksonov/react-native-router-flux/issues/1803`}</a>{`
`}<a parentName="p" {...{
        "href": "https://github.com/facebook/react-native/issues/13390"
      }}>{`https://github.com/facebook/react-native/issues/13390`}</a>{`
`}<a parentName="p" {...{
        "href": "https://github.com/react-community/react-navigation/issues/923"
      }}>{`https://github.com/react-community/react-navigation/issues/923`}</a>{`
`}<a parentName="p" {...{
        "href": "https://github.com/aksonov/react-native-router-flux/issues/1816"
      }}>{`https://github.com/aksonov/react-native-router-flux/issues/1816`}</a></p>
    <p><strong parentName="p">{`General React Native Commands`}</strong></p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`react-native upgrade`}</inlineCode>{` - upgrade the files being used `}</li>
      <li parentName="ul"><inlineCode parentName="li">{`react-native-git-upgrade`}</inlineCode>{` - newer upgrade (needs to be install globally first)`}</li>
    </ul>
    <p><strong parentName="p">{`Issues with React/ build path in Xcode?`}</strong></p>
    <p><a parentName="p" {...{
        "href": "https://github.com/oblador/react-native-vector-icons/issues/373"
      }}>{`https://github.com/oblador/react-native-vector-icons/issues/373`}</a></p>
    <p><strong parentName="p">{`Other issues`}</strong></p>
    <ul>
      <li parentName="ul">{`Ensure Cocoapods is up to date `}<inlineCode parentName="li">{`sudo gem install cocoapods`}</inlineCode></li>
    </ul>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
